Verenigde Staten
Thriller / Horror
85 minuten

goed

met Scott Speedman, Liv Tyler en Glenn Howerton

Een jong koppel brengt de nacht door in het afgelegen vakantiehuisje van de ouders van de man, na het bezoeken van een bruiloft. 
De nacht verandert echter in een nachtmerrie als ze worden aangevallen door drie gemaskerde vreemdelingen. Het koppel moet boven 
henzelf uitstijgen om de aanvallers tegenstand te bieden en te overleven.
